func FixmeTestJsonWithZLIBcompression(t *testing.T) {
	jsonString := `{"timestamp":"2018-06-09T11:57:57.500","producer":"eosio","confirmed":0,"previous":"000000b0090f3beb6593010f6d0623f7367af83544afabe1715e1a43fe94c699","transaction_mroot":"7c8e49e232e0ef11b997246fbde51a596e95ce46a65f5ca21ab0b8769c34ec8a","action_mroot":"d1b6c6a9c016ad1c130b161f6041e598ba170bcee7d7dd5ef8b9d7b489f7ff75","schedule_version":0,"new_producers":null,"header_extensions":[],"producer_signature":"SIG_K1_K2wGMewyNR4sgLeKgzJdQk6sXSkwvpBweNvSPMv3wE8gDUYDvvMUtwDpsswUz17X33zmk9gEGcAuDGdkbKaK7NQeR64y8M","transactions":[{"status":"executed","cpu_usage_us":3270,"net_usage_words":1108,"trx":{"id":"c9f28cf4fa099d0c64b3bc1fe4b0a389754b181e46d23b6640d323f418beea4f","signatures":["SIG_K1_JzFpJxiVsU1vtvaW2QUBf65f1XjFmus2UVqpJjz5RyH2ippF34g79NkFmZJhTHvskXn19MQYHq4R8KWt7GMHauqVsNTKSK"],"compression":"zlib","packed_context_free_data":"","context_free_data":[],"packed_trx":"","transaction":{"expiration":"2018-06-09T11:58:27","ref_block_num":175,"ref_block_prefix":3727162172,"max_net_usage_words":0,"max_cpu_usage_ms":0,"delay_sec":0,"context_free_actions":[],"actions":[{"account":"eosio","name":"setcode","authorization":[{"actor":"eosio.msig","permission":"active"}],"data":{"account":"eosio.msig","vmtype":0,"vmversion":0,"code":""},"hex_data":""},{"account":"eosio","name":"setabi","authorization":[{"actor":"eosio.msig","permission":"active"}],"data":{"account":"eosio.msig","abi":""},"hex_data":""}],"transaction_extensions":[]}}}],"block_extensions":[],"id":"000000b177f6f2e5a0d29837ede5dff616178aece8f4c9f891f376f186f1cb72","block_num":177,"ref_block_prefix":932762272}`
	jsonDataSignedBlock := []byte(jsonString)

	signedBlock := &SignedBlock{}

	err := json.Unmarshal(jsonDataSignedBlock, signedBlock)
	assert.NoError(t, err)

	tx := signedBlock.Transactions[0]
	assert.NoError(t, err)

	unpacked, err := tx.Transaction.Packed.Unpack()
	assert.NoError(t, err)

	assert.Equal(t, 2, len(unpacked.Actions))

	packed, err := unpacked.Pack(CompressionZlib)
	assert.NoError(t, err)

	EqualNoDiff(t,
		unpacked.packed.PackedTransaction,
		packed.PackedTransaction,
		fmt.Sprintf("\nActual: Unpack -> Pack (len=%d)\nExpected: Pack (len=%d)",
			len(unpacked.packed.PackedTransaction),
			len(packed.PackedTransaction)))
}

func EqualNoDiff(t *testing.T, expected interface{}, actual interface{}, message string) bool {
	if !assert.ObjectsAreEqual(expected, actual) {
		return assert.Fail(t, fmt.Sprintf("Not equal: %s\n", message))
	}

	return true
}

func TestBlob(t *testing.T) {
	b := Blob("RU9TIEdv")

	t.Run("String", func(tt *testing.T) {
		assert.Equal(tt, "RU9TIEdv", b.String())
	})

	t.Run("Data", func(tt *testing.T) {
		data, err := b.Data()
		require.Nil(tt, err)
		assert.Equal(tt, []byte("EOS Go"), data)
	})

	t.Run("malformed data", func(tt *testing.T) {
		b := Blob("not base64")
		data, err := b.Data()
		require.Equal(tt, "illegal base64 data at input byte 3", err.Error())
		assert.Empty(tt, data)
	})
}
